import React from "react"
import { Col, Container, Row } from "react-bootstrap";
import TypeBar from "../components/TypeBar";

const Shop = (props) => {
  return (
    <Container>
      <Row className="mt-2">
        <Col md={3}>
          <TypeBar/>
        </Col>
        <Col md={9}>
        </Col>
      </Row>
    </Container>
  )
};

export default Shop;
